import React from "react";
import { FcFolder, FcFile } from "react-icons/fc";
import "./files.css";

const FileStruct = ({ data }) => {
  const { name, type } = data;
  return (
    <div>
      <FcFolder />
      <span>{name}</span>
    </div>
  );
};

export default FileStruct;
